import React from 'react'

function HomePage() {
    return (
        <div className="HomePage">
            <header className="hero">
                <h1 className="hero-text">
                    Hi, I am 
                    <span>Vrudit Patel.</span>
                </h1>
            </header>
        </div>
    )
}
